import './Phone.css';
import React from 'react'
import phone from '../../assets/photos/5cb0633d80f2cf201a4c3253.png'
import Main from '../main/Main';

const Phone = () => {
  return (
    <div className='phone-container'>
        <img className='phone-photo' src={phone}></img>
        <Main />
    </div>
  )
}

export default Phone
